import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const LoginPage = () => {
  const [formData, setFormData] = useState({
    email: '',
    password: '',
    rememberMe: false
  });
  const [isLoading, setIsLoading] = useState(false);
  const navigate = useNavigate();

  const handleInputChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setIsLoading(true);
    
    // Simulate API call
    setTimeout(() => {
      console.log('Login data:', formData);
      setIsLoading(false);
      // Redirect after successful login
      navigate('/');
    }, 1500);
  };

  const handleForgotPassword = () => {
    // Handle forgot password logic
    console.log('Forgot password clicked');
  };

  return (
    <>
      <nav id="menu" className="fake_menu"></nav>
      
      {/* Preloader - shows during form submission */}
      {isLoading && (
        <div id="preloader">
          <div data-loader="circle-side"></div>
        </div>
      )}
      
      <div id="login">
        <aside>
          <figure>
            <a href="/">
              <img 
                src="/assets/img/logo_sticky.svg" 
                width="140" 
                height="35" 
                alt="Vanno Logo" 
                className="logo_sticky" 
              />
            </a>
          </figure>
          
          <div className="access_social">
            <a href="#0" className="social_bt facebook">Register with Facebook</a>
            <a href="#0" className="social_bt google">Register with Google</a>
          </div>
           
          <div className="divider"><span>Or</span></div>

          <form onSubmit={handleSubmit}>
                                   
            <div className="form-group">
              <input
                type="email"
                className="form-control"
                name="email"
                id="email"
                placeholder="Username/Email"
                value={formData.email}
                onChange={handleInputChange}
                required
              />
              <i className="icon_mail_alt"></i>
            </div>
            
            <div className="form-group">
              <input
                type="password"
                className="form-control"
                name="password"
                id="password"
                placeholder="Password"
                value={formData.password}
                onChange={handleInputChange}
                required
              />
              <i className="icon_lock_alt"></i>
            </div>
            
            <div className="clearfix add_bottom_30">
              <div className="checkboxes float-start">
                <label className="container_check">
                  Remember me
                  <input
                    type="checkbox"
                    name="rememberMe"
                    checked={formData.rememberMe}
                    onChange={handleInputChange}
                  />
                  <span className="checkmark"></span>
                </label>
              </div>
              <div className="float-end mt-1">
                <a id="forgot" href="javascript:void(0);">Forgot Password?</a>
              </div>
            </div>
            
            <button 
              type="submit" 
              className="btn_1 rounded full-width"
              disabled={isLoading}
            >
              {isLoading ? 'Logging in...' : 'Login to Vanno'}
            </button>
            
            <div className="text-center add_top_10">
              New to Vanno? <strong><a href="/register">Sign up!</a></strong>
            </div>
          </form>
          
          <div className="copy">© {new Date().getFullYear()} Vanno</div>
        </aside>
      </div>
    </>
  );
};

export default LoginPage;
